Using Express.js and MongoDB, How am I able to add Objects to the same Array?<p>I have a collection with Products. The collection is structured like this: </p>

<pre><code>{
        "_id": "150",
        "name": "Milk",
        "description": "Skimmed",
        "price": "10",
},
</code></pre>

<p>I want to add a new Object in that array called 'ratings' which would simply take in 'email' and 'ratings' <br></p>

<p>This would look like: </p>

<pre><code>   {
        "_id": "150",
        "name": "Milk",
        "description": "Skimmed",
        "price": "10",
        "ratings": [
                  { 
                    "email": "xyz@mail.com",
                    "rating": "5"
                  }
                  ]
}
</code></pre>

<p>However, I want 'Milk' to have more ratings than just one. Such that I can loop through the ratings at the front-end and output an average. Essentially, anytime a user rates 'milk' i want it to get added to the same Array? I'm new to this and hence can't explain in specific terms. 
Basically: </p>

<pre><code>{
            "_id": "150",
            "name": "Milk",
            "description": "Skimmed",
            "price": "10",
            "ratings": [
                      { 
                        "email": "xyz@mail.com",
                        "rating": "5"
                      },
                      { 
                       "email": "abc@mail.com",
                       "rating": "3"
                      },
                      { 
                       "email": "def@mail.com",
                       "rating": "1"
                      },
                      ]
}
</code></pre>

<p>Using Express, I created a <code>router.post</code> that looks like this.</p>

<pre><code>router.post('/', async (req, res) =&gt; { 
    const rate = await loadProducts();
try {
    rate.insertOne(

    {
    "ratings": 
    [{
        "email":req.body.email,
        "rating":req.body.rating
    }]
}); 
} catch (error) {
    console.log(error);
}
</code></pre>

<p>This is obviously not the way to do it as posting via it creates a new Array in the collection. I want it to basically Find the product using <code>"_id"</code>, something I will provide using the front-end, and add 'ratings' to that <code>"_id"</code></p>

<p>Extremely sorry for my novice explanation. Trying to get a grip of this. </p>

<p>Any help will be highly appreciated. </p>

