How to trace possible async race conditions in my test code?<p>I am learning modern JavaScript, and am writing a little API. I plan to host it in MongoDB Stitch, which is a serverless lambda-like environment. I am writing functions in the way that this system requires, and then adding Jest functions to be run locally and in continuous integration.</p>

<p>I am learning Jest as I go, and for the most part, I like it, and my prior experience with Mockery in PHP is making it a fairly painless experience. However, I have an odd situation where my lack of knowledge of JavaScript is stopping my progress. I have a failing test, but it is intermittent, and if I run all of the tests, sometimes it all passes, and sometimes the test that fails changes from one to another. This behaviour, coupled with my using <code>async</code>-<code>await</code> makes me think I am experiencing a race condition.</p>

<p>Here is my SUT:</p>

<pre><code>exports = async function(delay) {
    /**
     * @todo The lambda only has 60 seconds to run, so it should test how
     * long it has been running in the loop, and exit before it gets to,
     * say, 50 seconds.
     */

    let query;
    let ok;
    let count = 0;

    for (let i = 0; i &lt; 5; i++) {
        query = await context.functions.execute('getNextQuery');
        if (query) {
            ok = context.functions.execute('runQuery', query.phrase, query.user_id);
            if (ok) {
                await context.functions.execute('markQueryAsRun', query._id);
                count++;
            }
        } else {
            break;
        }

        // Be nice to the API
        await sleep(delay);
    }

    return count;

    function sleep(ms) {
        return new Promise(resolve =&gt; setTimeout(resolve, ms));
    }
};
</code></pre>

<p>The <code>content.functions</code> object is a global in Stitch, but as I show below, it is mocked inside Jest. Stitch is not involved in these tests at all.</p>

<p>As you can see, <code>getNextQuery</code> and <code>markQueryAsRun</code> are awaited, as they are defined as <code>async</code>.</p>

<p>Here is my main test:</p>

<pre><code>// Main SUT
const findAndRunQueries = require('./_source');

// Utility test classes
const MongoTester = require('../../test/mongo-tester');
const StitchFuncMocking = require('../../test/stitch-func-mocking');

// Other functions for the integration test
const getNextQuery = require('../getNextQuery/_source');
const markQueryAsRun = require('../markQueryAsRun/_source');

describe('Some integration tests for findAndRunQueries', () =&gt; {
    const mongoTester = new MongoTester('findAndRunQueries-integration');
    const stitchFuncMocking = new StitchFuncMocking();

    beforeAll(async () =&gt; {
        await mongoTester.connect();
        console.log('Connect');
    });

    afterAll(async () =&gt; {
        await mongoTester.disconnect();
        console.log('Disconnect');
    });

    beforeEach(async () =&gt; {
        // Set up global values
        global.context = {};
        global.context.services = mongoTester.getStitchContext();
        global.context.functions = stitchFuncMocking.getFunctionsObject(jest);

        // Delete existing mocks
        jest.clearAllMocks();
        stitchFuncMocking.clearMocks();

        // Connect some real implementations
        stitchFuncMocking.setGlobalMock('getNextQuery', getNextQuery);
        stitchFuncMocking.setGlobalMock('markQueryAsRun', markQueryAsRun);

        // Truncate all collections in use
        await mongoTester.emptyCollections(['queries']);
        console.log('Init mocks and clear collections');
    });

    test('end-to-end test with no queries', async () =&gt; {
        expect(await findAndRunQueries(0)).toBe(0);
    });

    test('end-to-end test with one successful query', async () =&gt; {

        // Here is a query entry
        await mongoTester.getDatabase().collection('queries').insertOne({
            "user_id": 1,
            "phrase": 'hello',
            "last_run_at": null,
            "enabled": true
        });

        var d = await mongoTester.getDatabase().collection('queries').findOne({});
        console.log(d);

        // We need to mock runQuery, as that calls an external API
        stitchFuncMocking.setGlobalMock('runQuery', () =&gt; 123);

        // Let's see if we can run a call sucessfully
        expect(await findAndRunQueries(0)).toBe(1);

        // @todo Check that a log entry has been made
    });

});
</code></pre>

<p>From this code you can see that <code>getNextQuery</code> and <code>markQueryAsRun</code> are wired to their real implementations (since this is an integration test) but <code>runQuery</code> is a mock, because I don't want this test to make HTTP calls.</p>

<p>For brevity, I am not showing the above code, as I don't think it is needed to answer the question. I am also not showing all of <code>MongoTester</code> or any of <code>StitchFuncMocking</code> (these connect to an in-memory MongoDB instance and simplify Jest mocking respectively).</p>

<p>For database-level tests, I run this <code>MongoTester</code> utility function to clear down collections:</p>

<pre><code>    this.emptyCollections = async function(collections) {
        // Interesting note - how can I do deleteMany without async, but
        // wait for all promises to finish before the end of emptyCollections?
        collections.forEach(async (collectionName) =&gt; {
            let collection = this.getDatabase().collection(collectionName);
            await collection.deleteMany({});
        });
    };
</code></pre>

<p>This is how I am running the test:</p>

<pre><code>sh bin/test-compile.sh &amp;&amp; node node_modules/jest/bin/jest.js -w 1 functions/findAndRunQueries/
</code></pre>

<p>The compilation step can be ignored (it just converts the <code>exports</code> to <code>module.exports</code>, <a href="https://stackoverflow.com/a/59228745">see more here</a>). I then run this test plus a unit test inside the <code>functions/findAndRunQueries/</code> folder. The <code>-w 1</code> is to run a single thread, in case Jest does some weird parallelisation.</p>

<p>Here is a good run (containing some noisy console logging):</p>

<pre><code>root@074f74105081:~# sh bin/test-compile.sh &amp;&amp; node node_modules/jest/bin/jest.js -w 1 functions/findAndRunQueries/
 PASS  functions/findAndRunQueries/findAndRunQueries.integration.test.js
  ● Console

    console.log functions/findAndRunQueries/findAndRunQueries.integration.test.js:18
      Connect
    console.log functions/findAndRunQueries/findAndRunQueries.integration.test.js:42
      Init mocks and clear collections
    console.log functions/findAndRunQueries/findAndRunQueries.integration.test.js:42
      Init mocks and clear collections
    console.log functions/findAndRunQueries/findAndRunQueries.integration.test.js:60
      { _id: 5e232c13dd95330804a07355,
        user_id: 1,
        phrase: 'hello',
        last_run_at: null,
        enabled: true }

 PASS  functions/findAndRunQueries/findAndRunQueries.test.js

Test Suites: 2 passed, 2 total
Tests:       6 passed, 6 total
Snapshots:   0 total
Time:        0.783s, estimated 1s
Ran all test suites matching /functions\/findAndRunQueries\//i.
</code></pre>

<p>In the "end-to-end test with one successful query" test, it inserts a document and then passes some assertions. However, here is another run:</p>

<pre><code>root@074f74105081:~# sh bin/test-compile.sh &amp;&amp; node node_modules/jest/bin/jest.js -w 1 functions/findAndRunQueries/
 FAIL  functions/findAndRunQueries/findAndRunQueries.integration.test.js
  ● Console

    console.log functions/findAndRunQueries/findAndRunQueries.integration.test.js:18
      Connect
    console.log functions/findAndRunQueries/findAndRunQueries.integration.test.js:42
      Init mocks and clear collections
    console.log functions/findAndRunQueries/findAndRunQueries.integration.test.js:42
      Init mocks and clear collections
    console.log functions/findAndRunQueries/findAndRunQueries.integration.test.js:60
      null

  ● Some integration tests for findAndRunQueries › end-to-end test with one successful query

    expect(received).toBe(expected) // Object.is equality

    Expected: 1
    Received: 0

      64 | 
      65 |         // Let's see if we can run a call sucessfully
    &gt; 66 |         expect(await findAndRunQueries(0)).toBe(1);
         |                                            ^
      67 | 
      68 |         // @todo Check that a log entry has been made
      69 |     });

      at Object.test (functions/findAndRunQueries/findAndRunQueries.integration.test.js:66:44)

 PASS  functions/findAndRunQueries/findAndRunQueries.test.js

Test Suites: 1 failed, 1 passed, 2 total
Tests:       1 failed, 5 passed, 6 total
Snapshots:   0 total
Time:        0.918s, estimated 1s
Ran all test suites matching /functions\/findAndRunQueries\//i.
</code></pre>

<p>The <code>null</code> in the log output indicates that the insert failed, but I do not see how that is possible. Here is the relevant code (reproduced from above):</p>

<pre><code>        await mongoTester.getDatabase().collection('queries').insertOne({
            "user_id": 1,
            "phrase": 'hello',
            "last_run_at": null,
            "enabled": true
        });

        var d = await mongoTester.getDatabase().collection('queries').findOne({});
        console.log(d);
</code></pre>

<p>I assume the <code>findOne()</code> returns a Promise, so I have <code>await</code>ed it, and it is still null. I also awaited the <code>insertOne()</code> as I reckon that probably returns a Promise too.</p>

<p>I wonder if my in-RAM MongoDB database might not be performing like a real Mongo instance, and I wonder if I should spin up a Docker MongoDB instance for testing.</p>

<p>However, perhaps there is just an async thing I have not understood? What can I dig into next? Is it possible that the MongoDB write concerns are set to the "don't confirm write before returning control"?</p>

<p>Also perhaps worth noting is that the "Disconnect" message does not seem to pop up. Am I not disconnecting from my test MongoDB instance, and could that cause a problem by leaving an in-memory server in a broken state?</p>

