Express: implementing MongoDB session store<p>Currently, I am requiring and defining options for <code>express-session</code> at the top of <code>index.js</code> as follows:</p>

<pre><code>const session = require(`express-session`)({
    secret: `MyEpicSecret`,
    resave: true,
    saveUninitialized: true,
    cookie: {maxAge: 1000 * 60} // 1 minute: for testing
}),
</code></pre>

<p>and I use it with my express app:</p>

<pre><code>app.use(session);
</code></pre>

<p>This layout is important because I later pass <code>session</code> to my socket.io module at the bottom of <code>index.js</code>:</p>

<pre><code>require(`./modules/socket.js`)(server, session);
</code></pre>

<p><br /></p>

<p>With the above design flow, my app functions as it should and sessions are handled and managed flawlessly. My goal now is to implement <code>connect-mongo</code> for saving sessions to a MongoDB. Their <a href="https://www.npmjs.com/package/connect-mongo%3E%3Cdocumentation" rel="nofollow noreferrer">documentation</a> is a little hazy, but from what I could understand I need to require the <code>express-session</code> module first then define the options to use <em>later</em> inside <code>app.use()</code>. This is an issue - if I define options inside <code>app.use()</code> I am no longer able to pass the configured session (it's options) when I require my <code>socket.js</code> module.</p>

<p>Would I would <em>like</em> to do do is something like:</p>

<pre><code>const session = require('express-session')({
    secret: `MyEpicSecret`,
    resave: true,
    saveUninitialized: true,
    cookie: {maxAge: 1000 * 60}, // 1 minute: for testing
    store: new MongoStore(options)
});
const MongoStore = require('connect-mongo')(session);

app.use(session);
</code></pre>

<p>This is not possible - <code>MongoStore</code> is not defined at the time I try to use it. If I move MongoStore <em>up</em>, <code>session</code> will be undefined when i require MongoStore.</p>

<p>I am still learning the ropes with express and would much appreciate the help that anyone is able to provide :)</p>

